import React from 'react';
import css from './ProfileAvatar.module.css'

const ProfileAvatar = (props) => {
    return (
      <div className={css.profile__avatar}>
        <img src={props.img} alt="avatar"></img>
      </div>
    )
}

export default ProfileAvatar;
